import React, {Component} from 'react';
import { makeStyles } from '@material-ui/styles';
import { Grid, Hidden, Container } from '@material-ui/core';
import windowSize from 'react-window-size';
import {
  Budget,
  TotalUsers,
  TasksProgress,
  TotalProfit,
  LatestSales,
  UsersByDevice,
  LatestProducts,
  LatestOrders,
  Filter,
  PropertyList,
  MapContainer
} from './components';
import './PropertySearch.css'
import { connect } from 'react-redux'

const MODAL_OPEN_CLASS = "body--modal-open";
makeStyles(theme => (
  {
  root: {
    padding: theme.spacing(0), width: 800, 
  }
}));
const isDesktop = 0;

class PropertySearch extends Component {

  componentDidMount() {
    document.body.classList.add(MODAL_OPEN_CLASS);
  }

  componentWillUnmount() {
    document.body.classList.remove(MODAL_OPEN_CLASS);
  }

  render(){
    console.log('Redux: ', this.props)
    if(isDesktop == 0){
      return (
        <div style={{maxWidth:800}}>
          <div style={{display:'flex', overflow:'hidden', overflowX: 'hidden'}}>
            <div className={makeStyles.root} style={{maxHeight: this.props.windowHeight - 75, overflow: 'auto', width:800}}>
                <Filter style={{padding:0}}></Filter>
                <Container style={{padding:20, width:'100%'}}>
                    <PropertyList></PropertyList>
                    <PropertyList></PropertyList>
              </Container>
            </div>

            <div>
                <MapContainer height={this.props.windowHeight-60} width={this.props.windowWidth-800}></MapContainer>
            </div>
          </div>
        </div>


        );
    } else {
        return(
            <div></div>
        );
    }
  };
  }

  const mapStateToProps = (state) => {
    return {
      posts: state.posts
    }
  }

export default connect(mapStateToProps)(windowSize(PropertySearch));
